import React from 'react'
import logo from './googlelogo_color.png';
import whitelogo from './googlelogo_white.png';
import './style.css';

function Logo() {
  return (
    <div>
    <picture>
      <source 
        srcset={whitelogo} 
        media="(prefers-color-scheme: dark)">
        <img src={logo} alt="logo"/>
        </source>
    </picture>
    <img src={logo} alt="logo" class="logo" />
    </div>
  )
}

export default Logo
